   "source": [
    "## Model Preparation\n",
    "\n",
    "We now see that the ADF test for the seasonally and trend adjusted time series for ICLN has a p value of approximately 0.01 This means that we can say within a 95% confidence interval that this time series is stationary.\n",
    "\n",
    "Before we build the model, we must select the optimal lag length to be used. We shall set the maximum lag at 4 as we intend to only test for the relationship of variables lagged as far as 1 year (4 quarters)."
   ]
  },
